description:
Category	Feature, Couples, Female Producers/Directors

Director	Stormy Daniels
Starring	Dahlia Sky, Erik Everhard, Xander Corvus, Stormy Daniels, Misty Stone, Lea Lexis, Gabriella Paltrova, Ryan Driller, Daniel Hunter

It's A Dirty Job, But...Well You Know The Drill!
Get Ready For Some Heavy Lifting!
Co-workers Carrie and Justin are both in need of some extra money. Carrie's looking for her own place, after discovering her boyfriend's secret sex tape and Justin's saving for an expensive engagement ring to satisfy his obnoxious girlfriend. As a result, they join forces and begin working odd jobs for extra money and before long...they begin to fall in love. With scintillating sex and 'laugh out loud' dialogue, 'Dirty Deeds' will satisfy couples and fans of romantic comedies, as well as, star and director, Stormy Daniels.

